//! 恢复空格

use std::collections::HashSet;

pub fn respace(dictionary: Vec<String>, sentence: String) -> i32 {
    let set = dictionary.into_iter().collect::<HashSet<String>>();
    let len = sentence.len();
    let mut dp = vec![0; len + 1];
    for i in 1..=len {
        let mut tmp = dp[i - 1] + 1;
        for start in 0..i {
            if set.contains(&sentence[start..i]) {
                tmp = tmp.min(dp[start]);
                if tmp == 0 {
                    break;
                }
            }
        }
        dp[i] = tmp;
    }
    dp[len]
}

const MOD: u64 = 1e9 as u64 + 9;
const BASE: u64 = 113;

pub fn respace_robin_karp_hash(dictionary: Vec<String>, sentence: String) -> i32 {
    let get_hash = |x: String| -> u64{
        let mut hash = 0;
        for i in x.bytes().rev() {
            hash = (hash * BASE + i as u64) % MOD;
        }
        hash
    };
    let set = dictionary.into_iter().map(|x| get_hash(x)).collect::<HashSet<u64>>();
    let sentence = sentence.as_bytes();
    let len = sentence.len();
    let mut dp = vec![0; len + 1];
    for i in 1..=len {
        let mut tmp = dp[i - 1] + 1;
        let mut hash = 0;
        for end in (0..i).rev() {
            hash = (hash * BASE + sentence[end] as u64) % MOD;
            if set.contains(&hash) {
                tmp = tmp.min(dp[end]);
                if tmp == 0 {
                    break;
                }
            }
        }
        dp[i] = tmp;
    }
    dp[len]
}


